### font rendering

def mirstamp_drawtext(text, draw):
    hpos = 0 # position of last drawn glyph, for combining
    hcur = 0 # position of cursor / next glyph to draw / width
    if fontdata[0] <= 8:
        mask = 0x80
    elif fontdata[0] <= 16:
        mask = 0x8000
    elif fontdata[0] <= 24:
        mask = 0x800000
    elif fontdata[0] <= 32:
        mask = 0x80000000
    for char in text:
        data = mirstamp_char(char)
        if data[0] != 0:
            hpos = hcur
            hcur += fontdata[0]
        for y in range(fontdata[1]):
            row = data[1][y]
            for col in range(fontdata[0]):
                if row & mask:
                    draw(hpos + col, y)
                row <<= 1


### helper functions

def mirstamp_char(char):
    wc = ord(char)
    if not wc in fontdata[2]:
        wc = fontreplacementchar
    return fontdata[2][wc]

# we need to roll our own, cf. http://bugs.python.org/issue12568
def mirstamp_wcwidth(char):
    return mirstamp_char(char)[0]

def mirstamp_wcswidth(text):
    return sum(mirstamp_char(char)[0] for char in text)


### plugin entry point

def do_mirstamp(timg, tdrawable, text, colour, bgcol, trns, halign, valign, hofs, vofs):
    if isinstance(u"", str):
        if isinstance(text, bytes):
            text = text.decode('UTF-8')
        text = str(text)
    else:
        if not isinstance(text, unicode):
            text = str(text).decode('UTF-8')
        text = unicode(text)

    w = fontdata[0] * mirstamp_wcswidth(text)
    h = fontdata[1]
    tl = gimp.Layer(timg, "tmp", w, h, RGBA_IMAGE, 100, NORMAL_MODE)
    if trns:
        tl.fill(TRANSPARENT_FILL)
    else:
        oldbg = gimp.get_background()
        gimp.set_background(bgcol)
        tl.fill(BACKGROUND_FILL)
        gimp.set_background(oldbg)
    pr = tl.get_pixel_rgn(0, 0, w, h)
    if len(pr[0, 0]) != 4:
        raise Exception("number of channels (%d) unexpectedly not 4" % len(pr[0, 0]))
    fb = array("B", pr[0:w, 0:h])
    bcol = array("B", colour)
    if len(bcol.tostring()) == 3:
        bcol.append(0xFF)
    elif len(bcol.tostring()) != 4:
        raise Exception("text colour number of channels (%d) unexpectedly not 4" % len(bcol.tostring()))
    def draw(x, y):
        ptr = (y * w + x) * 4
        fb[ptr:ptr+4] = bcol
    mirstamp_drawtext(text, draw)
    pr[0:w, 0:h] = fb.tostring()
    if halign == 0:
        hx = 0
    elif halign == 1:
        hx = timg.width / 2 - w / 2
    elif halign == 2:
        hx = timg.width - w
    if valign == 0:
        vx = 0
    elif valign == 1:
        vx = timg.height / 2 - h / 2
    elif valign == 2:
        vx = timg.height - h
    tl.set_offsets(hx + hofs, vx - vofs)
    timg.add_layer(tl, -1)
    timg.flatten()

